<div class="container">
  <div class="row">
    <div class="col-4">
        <nav class="navbar navbar-light bg-light">
            <div id="NAVINFO">
            </div>
        </nav>
    </div>
    <div class="col-8">
        <center><h3 id="TITLE_HEADER">Maps</h3></center>
        <div id="MAPINFO">
        </div>
        <div id="STATINFO">
        </div>
    </div>
  </div>
</div>

  <script type="text/html" id="sidenav-template">
      {{#parkinfo}}
      <ul class="navbar-nav">
         <li class="nav-item">{{AN}} ({{AC}})
             <ul>
                 {{#parks}}
                 <li class="nav-item">
                     <a href="javascript:show_area_latlong_in_osm('{{PN}}', '{{PID}}', 0, '{{PLAT}}', '{{PLONG}}');">
                        {{PID}}. {{PN}}
                     </a>
                 </li>
                 {{/parks}}
             </ul>
         </li>
      </ul>
      {{/parkinfo}}
      {{#wardinfo}}
      <ul class="navbar-nav">
         <li class="nav-item">
             <a href="javascript:show_area_latlong_in_osm('{{AN}}', '{{AID}}', 0, '{{ALAT}}', '{{ALONG}}');">
                {{AID}}. {{AN}} ({{AC}})
             </a>
         </li>
      </ul>
      {{/wardinfo}}
      {{#mapinfo}}
      <ul class="navbar-nav">
         <li class="nav-item">
             <a href="javascript:show_area_latlong_in_osm('{{AN}}', '{{AID}}', 0, '{{ALAT}}', '{{ALONG}}');">
                {{AID}}. {{AN}} ({{AC}})
             </a>
         </li>
      </ul>
      {{/mapinfo}}
  </script>

  <script type="text/html" id="stats-template">
      <table border="0" cellpadding="4" class="table table-striped table-condensed" >
      <tbody>
        {{#parkinfo}}
            <tr><td><b><strong>{{AN}}</strong></b></td><td><em>{{{AC}}}</em></td></tr>
        {{/parkinfo}}
        {{#wardinfo}}
            <tr><td><b><strong>{{AN}}</strong></b></td><td><em>{{{AC}}}</em></td></tr>
        {{/wardinfo}}
    </tbody>
    </table>
  </script>

  <script type="text/html" id="tree-stats-template">
      <table border="0" cellpadding="4" class="table table-striped table-condensed" >

          {{#trees}}

                 </a>
               </td>
               <td>
                 <em>{{{TC}}}</em>
               </td>
           </tr>
          {{/trees}}
      </tbody>
      </table>
  </script>
